import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

import Index from './composants/views/Index';
import AllSalle from './composants/views/AllSalle';


const Stack = createNativeStackNavigator();

function App() {
  return (
       <NavigationContainer>
          <Stack.Navigator>
              <Stack.Screen 
                name="Home" 
                component={Index} 
                option={{
                    headerStyle: {
                      backgroundColor: '#0E4452',
                    },
                    headerTintColor: '#fff',
                    headerTitleStyle: {
                      fontWeight: 'bold',
                    },
                  }}
              />
              <Stack.Screen 
                  name="Listes des salles" 
                  component={AllSalle} 
                  option={{
                    title: 'My home',
                    headerStyle: {
                      backgroundColor: '#0E4452',
                    },
                    headerTintColor: '#fff',
                    headerTitleStyle: {
                      fontWeight: 'bold',
                    },
                  }}
              />
          </Stack.Navigator>
       </NavigationContainer>
  );
}

export default App;
